import React, { useState, useEffect, useRef } from 'react';
import 'animate.css';
import './Feature.css'; // Import your styles

export default function Feature3() {
  const [expandedSection, setExpandedSection] = useState(null); // Tracks expanded section
  const [imageSrc, setImageSrc] = useState(
    'https://yellow.ai/wp-content/uploads/2024/06/healthcare-inline-img-1-1-1010x1024.webp'
  );

  const [isInView, setIsInView] = useState(false);
  const featureRef = useRef(null);

  // Scroll animation handler
  useEffect(() => {
    const handleScroll = () => {
      const topPos = featureRef.current?.getBoundingClientRect().top;
      const windowHeight = window.innerHeight;
      if (topPos < windowHeight - 100) {
        setIsInView(true);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const handleToggle = (section, imgSrc) => {
    setExpandedSection(expandedSection === section ? null : section);
    setImageSrc(imgSrc);
  };

  return (
    <div ref={featureRef}>
      <div className="row">
        {/* Image Column */}
        <div className={`col-md-4 p-0 d-flex justify-content-center align-items-center ${isInView ? 'animate__animated animate__fadeInLeft' : ''} mb-4 mb-md-0`}>
          <img
            src={imageSrc}
            alt="Healthcare journey illustration"
            className="img-fluid"
            style={{ marginTop: '50px' }}
          />
        </div>

        {/* Text Column */}
        <div className={`col-md-8 d-flex align-items-center justify-content-center ${isInView ? 'animate__animated animate__fadeInRight' : ''}`}>
          <div className="text-center">
            <div className="row text-start fs-2 fw-bold">
              <h2>
                Secure patient data with <br /> robust compliance <br /> measures
              </h2>
            </div>
            <div className="row text-start">
              <p>
                Don’t compromise on data privacy and security to earn patients’ trust. Yellow.ai has <br /> got you covered with ISO, HIPAA, SOC2, GDPR, and PDPA compliance.
              </p>
            </div>

            {/* Toggle Sections */}
            <div className="row my-4">
              <button
                className="btn btn-link p-0 text-start text-dark toggle-button"
                onClick={() => handleToggle('security', 'https://yellow.ai/wp-content/uploads/2024/06/healthcare-inline-img-1-1-1010x1024.webp')}
              >
                <div className="col-sm-8 fw-bold" style={{ fontSize: '20px', fontFamily: 'inherit' }}>
                  Appointment booking and rescheduling
                </div>
                <div className="col-sm-2">
                  <img
                    src={expandedSection === 'security'
                      ? 'https://cdn-icons-png.flaticon.com/512/262/262039.png'
                      : 'https://cdn-icons-png.flaticon.com/128/3024/3024515.png'}
                    alt={expandedSection === 'security' ? 'Minus icon' : 'Plus icon'}
                    className="toggle-icon"
                  />
                </div>
              </button>

              <div className={`collapse-content ${expandedSection === 'security' ? 'expand' : ''} text-start`}>
                Automate booking and updating of appointments <br /> and lab tests. Free up healthcare agents for high-value tasks.
              </div>
            </div>

            <div className="row my-4">
              <button
                className="btn btn-link p-0 text-start text-dark toggle-button"
                onClick={() => handleToggle('alerts', 'https://yellow.ai/wp-content/uploads/2024/06/healthcare-inline-img-1-2-1010x1024.webp')}
              >
                <div className="col-sm-8 fw-bold" style={{ fontSize: '20px', fontFamily: 'inherit' }}>
                  Human-like voice interactions
                </div>
                <div className="col-sm-2">
                  <img
                    src={expandedSection === 'alerts'
                      ? 'https://cdn-icons-png.flaticon.com/512/262/262039.png'
                      : 'https://cdn-icons-png.flaticon.com/128/3024/3024515.png'}
                    alt={expandedSection === 'alerts' ? 'Minus icon' : 'Plus icon'}
                    className="toggle-icon"
                  />
                </div>
              </button>

              <div className={`collapse-content ${expandedSection === 'alerts' ? 'expand' : ''} text-start`}>
                Automate booking and updating of appointments and lab tests. Free <br /> up healthcare agents for high-value tasks.
              </div>
            </div>

            <div className="row my-4">
              <button
                className="btn btn-link p-0 text-start text-dark toggle-button"
                onClick={() => handleToggle('lab', 'https://yellow.ai/wp-content/uploads/2024/06/healthcare-inline-img-1-3-1010x1024.webp')}
              >
                <div className="col-sm-8 fw-bold" style={{ fontSize: '20px', fontFamily: 'inherit' }}>
                  Secure billing and payments
                </div>
                <div className="col-sm-2">
                  <img
                    src={expandedSection === 'lab'
                      ? 'https://cdn-icons-png.flaticon.com/512/262/262039.png'
                      : 'https://cdn-icons-png.flaticon.com/128/3024/3024515.png'}
                    alt={expandedSection === 'lab' ? 'Minus icon' : 'Plus icon'}
                    className="toggle-icon"
                  />
                </div>
              </button>

              <div className={`collapse-content ${expandedSection === 'lab' ? 'expand' : ''} text-start`}>
                Tackle interruptions with empathy using voice AI agents, <br /> adept in active listening. Transfer complex queries to live agents.
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
